insert into artist(name, profile, description)
values ('The Strokes', 'https://i.guim.co.uk/img/media/d1ecdacdbb470243fc248a5b38bc521de6aae4e0/52_84_2430_1457/master/2430.jpg?width=1200&quality=85&auto=format&fit=max&s=ea38beaf0a4e51b9e214e025cf4b10fb', 'The Strokes are an American rock band formed in New York City in 1998. The band is composed of lead singer and primary songwriter Julian Casablancas, guitarists Nick Valensi and Albert Hammond Jr., bassist Nikolai Fraiture, and drummer Fabrizio Moretti. They were a leading group of the early-2000s post-punk revival and garage rock revival movements.');

insert into artist(name, profile, description)
values ('TV Girl', 'data:image/jpeg;base64,', 'TV Girl was formed in San Diego in 2010, by friends Trung Ngo and Brad Petering as a leisure activity with no particular ambition other than experimenting and hanging out. That same year, the band released their self-titled debut EP, which attracted attention when they sampled Todd Rundgrens 1973 solo version of "Hello Its Me" on their song "If You Want It" from the EP, leading to a takedown notice on the band, issued by Rhino Entertainment, who owns full rights to the Rundgren song.');

insert into artist(name,profile, description)
values ('Radiohead', 'data:image/jpeg;base64,', 'Radiohead are an English rock band formed in Abingdon, Oxfordshire, in 1985. They comprise Thom Yorke (vocals, guitar, piano, keyboards); brothers Jonny Greenwood (guitar, keyboards, other instruments) and Colin Greenwood (bass); Ed OBrien (guitar, backing vocals); and Philip Selway (drums, percussion). They have worked with the producer Nigel Godrich and the cover artist Stanley Donwood since 1994. Radioheads experimental approach is credited with advancing the sound of alternative rock.');

insert into artist(name, profile, description)
values ('Brockhampton', 'data:image/jpeg;base64,', 'Brockhampton were an American boy band/rap collective founded in 2014 in San Marcos, Texas. Led by Kevin Abstract and formed partially through the online music discussion forum KanyeToThe, the group''s final line-up consisted of vocalists Abstract, Matt Champion, Merlyn Wood, and Dom McLennon, vocalists/producers Joba, Bearface, and Jabari Manwa and producers Romil Hemnani and Kiko Merley, as well as graphic designer Henock "HK" Sileshi, photographer Ashlan Grey, web designer Roberto Ontenient (who also featured prominently in voice skits), and manager Jon Nunes.');

insert into artist(name, profile, description)
values ('Regina Spektor', 'data:image/jpeg;base64,', 'Regina Ilyinichna Spektor born February 18, 1980) is a Russian-born American singer, songwriter, and pianist. After self-releasing her first three records and gaining popularity in New York City''s independent music scenes, particularly the anti-folk scene centered on New York City''s East Village, Spektor signed with Sire Records in 2004 resulting in greater mainstream recognition. After giving her third album Soviet Kitsch a major label re-release, Sire released Spektor''s fourth album, Begin to Hope, which achieved a Gold certification by the RIAA.Her following two albums, Far and What We Saw from the Cheap Seats, each debuted at number 3 on the Billboard 200.');

insert into artist(name, profile, description)
values ('Elliott Smith', 'data:image/jpeg;base64,', 'Steven Paul Smith (August 6, 1969 – October 21, 2003), known as Elliott Smith, was an American musician and singer-songwriter. He was born in Omaha, Nebraska, raised primarily in Texas, and lived much of his life in Portland, Oregon, where he gained popularity. Smith''s primary instrument was the guitar, though he also played piano, clarinet, bass guitar, drums, and harmonica. He had a distinctive vocal style in his solo career after Heatmiser, characterized by his "whispery, spiderweb-thin delivery", and often used multi-tracking to create vocal layers, textures, and harmonies that were usually finger picked and recorded with tape.');

